import React from 'react';
import WordGuessImage from '../images/Word_Guess.png';
import { Image, Container, Grid } from 'semantic-ui-react'

function WordGuess() {
    return(
    <Container>
        <Grid>
            <Grid.Row>
                <Grid.Column>
                    <Image src={WordGuessImage} size="massive"/> <br />
                        <b>Description: </b>Can you guess the correct classic video game? <br />
                        <b>Languages: </b>HTML, CSS, Javascript
                </Grid.Column>
            </Grid.Row>
        </Grid>
    </Container>
    )
}

export default WordGuess;
